  <meta charset="utf-8">

  <title>
    CoffePack
  </title>

  <!--http://www.html5rocks.com/en/mobile/mobifying/-->
  <meta name="viewport" content="width=device-width,user-scalable=no,initial-scale=1,minimum-scale=1,maximum-scale=1,minimal-ui=true">

  <!--https://developer.apple.com/library/safari/documentation/AppleApplications/Reference/SafariHTMLRef/Articles/MetaTags.html-->

  <meta name="apple-mobile-web-app-status-bar-style" content="black-translucent">
  <meta name="format-detection" content="telephone=no">

  <!-- force webkit on 360 -->

  <meta name="force-rendering" content="webkit">
  <!-- force edge on IE -->
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
  <meta name="msapplication-tap-highlight" content="no">

  <!-- force full screen on some browser -->
  <meta name="full-screen" content="yes">
  <meta name="x5-fullscreen" content="true">
  <meta name="360-fullscreen" content="true">

  <!--fix fireball/issues/3568 -->
  <!--<meta name="browsermode" content="application">-->

  <!--<link rel="apple-touch-icon-precomposed" href=".png" />-->

  

  <script type="text/javascript">
    // Wait for the SDK to become ready 
    if (window["mraid"]) {
      if (mraid.getState() === 'loading') {
        mraid.addEventListener('ready', onSdkReady);
      } else {
        onSdkReady();
      }
      function onSdkReady() {
        // Wait for the ad to become viewable for the first time
        if (mraid.isViewable()) {
          showMyAd();
        } else {
          mraid.addEventListener('viewableChange', function (viewable) {
            if (viewable) {
              mraid.removeEventListener('viewableChange', arguments.callee);
              showMyAd();
            }
          });
        }
      }
      function showMyAd() {
        startGame();
      }
      function mraidFixInstall() {
        if (sys.os == sys.OS.IOS || sys.os == sys.OS.OSX) {
          mraid.open("https://apps.apple.com/us/app/coffee-please-sort-puzzle/id6667101094");
          return;
        }

        mraid.open("https://play.google.com/store/apps/details?id=com.coffeeplease.packingpuzzle&gl=us");
      }
    }
  </script>
  <script>
    function gameStart() { };
    function gameClose() { };
  </script>
<style>html {
  -ms-touch-action: none;
}

body, canvas, div {
  display: block;
  outline: none;
  -webkit-tap-highlight-color: rgba(0, 0, 0, 0);

  user-select: none;
  -moz-user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -khtml-user-select: none;
  -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
}

/* Remove spin of input type number */
input::-webkit-outer-spin-button,
input::-webkit-inner-spin-button {
    /* display: none; <- Crashes Chrome on hover */
    -webkit-appearance: none;
    margin: 0; /* <-- Apparently some margin are still there even though it's hidden */
}

body {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  padding: 0;
  border: 0;
  margin: 0;

  cursor: default;
  color: #888;
  background-color: #333;

  text-align: center;
  font-family: Helvetica, Verdana, Arial, sans-serif;

  display: flex;
  flex-direction: column;
}

canvas {
  background-color: rgba(0, 0, 0, 0);
}

#GameDiv, #Cocos3dGameContainer, #GameCanvas {
  width: 100%;
  height: 100%;
}

:root {
  --safe-top: env(safe-area-inset-top);
  --safe-right: env(safe-area-inset-right);
  --safe-bottom: env(safe-area-inset-bottom);
  --safe-left: env(safe-area-inset-left);
}
